import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <button className='btn'>완두</button>
        <button className='btn'>땅콩</button>
        <button className='btn'>사랑</button>
        <button className='btn'>킁킁</button>
        <button className='btn'>쫑빈</button>
      </div>
      <div className='contents'></div>
      <div className='footer'></div>
    </div>
  );
}

export default App;
